// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "./SafeMath.sol";

contract FiniteField {
    using SafeMath for uint256;

    uint256 public p; // Primo modulo p

    // Struttura per rappresentare un elemento del campo finito
    struct Zp {
        uint256 value; // Valore dell'elemento (modulo p)
    }

    // Costruttore che inizializza il campo finito con un primo modulo p
    constructor(uint256 prime) {
        require(isPrime(prime), "p deve essere un numero primo.");
        p = prime;
    }

    // Funzione per verificare se un numero Ã¨ primo
    function isPrime(uint256 num) internal pure returns (bool) {
        if (num < 2) return false;
        for (uint256 i = 2; i * i <= num; i++) {
            if (num % i == 0) return false;
        }
        return true;
    }

    // Funzione per creare un elemento nel campo finito
    function createElement(uint256 value) public view returns (Zp memory) {
        console.log("created element with value %s", value);
        return Zp(value % p); // Restituisce l'elemento modulo p
    }

    // Operazione di somma nel campo finito
    function add(Zp calldata a, Zp calldata b) public view returns (Zp memory) {
        console.log("qui");
        Zp memory result = createElement((a.value.add(b.value)));
        console.log("%s", result.value);
        return result;
    }

    // Operazione di sottrazione nel campo finito
    function subtract(
        Zp memory a,
        Zp memory b
    ) public view returns (Zp memory) {
        return createElement((a.value.sub(b.value)));
    }

    // Operazione di moltiplicazione nel campo finito
    function multiply(
        Zp memory a,
        Zp memory b
    ) public view returns (Zp memory) {
        return createElement((a.value.mul(b.value)));
    }

    // Operazione di divisione nel campo finito (usando l'inverso moltiplicativo)
    function div(Zp memory a, Zp memory b) public view returns (Zp memory) {
        return multiply(a, inverse(b));
    }

    // Funzione per calcolare l'inverso moltiplicativo di un elemento nel campo finito
    function inverse(Zp memory a) public view returns (Zp memory) {
        require(a.value != 0, "Divisione per zero non permessa.");
        (uint256 x, , uint256 g) = extendedGCD(a.value, p);
        require(g == 1, "L'inverso non esiste");
        return createElement(x);
    }

    // Algoritmo di Euclide esteso per calcolare l'inverso moltiplicativo
    function extendedGCD(
        uint256 a,
        uint256 b
    ) internal pure returns (uint256, uint256, uint256) {
        if (b == 0) {
            return (uint256(1), uint256(0), uint256(a));
        } else {
            (uint256 x1, uint256 y1, uint256 gcd) = extendedGCD(b, a % b);
            return (y1, x1.sub(a.div(b)).mul(y1), gcd);
        }
    }
}

